function AddressItem({ value }) {
  const { address, num, district, city, state, CEP, complement } = value;
  return (

      <li>
        <p>Rua: { address }&nbsp;&nbsp; nÂº { num },&nbsp;&nbsp; complemento: { complement }</p>
        <p>Bairro: { district },  Cidade: { city }</p>
        <p>Estado: { state }, CEP: { CEP }</p>
      </li>
  )
}

export default AddressItem;
